import React from "react";

function Tail() {
  return (
    <div className="bg-red-200">
      <div className="max-w-5xl py-4 mx-auto flex flex-col">
        <div className="flex justify-between">
          <div className="flex">
            <div
              style={{
                size: "120px",
                backgroundImage:
                  "url('https://images.unsplash.com/photo-1497215728101-856f4ea42174?ixid=MnwxMjA3fDF8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=1050&q=80')",
              }}
            ></div>
          </div>
          <div></div>
        </div>
        <div className="flex justify-between"></div>
        대구아이캔 | 대구광역시 중구 국채보상로 123길 16, 3층
      </div>
    </div>
  );
}

export default Tail;
